In the field of bioinformatics, what are the key indicators of a successful genetic sequencing experiment? Can you create a program that takes in the genetic data as input and returns true if the experiment meets the criteria for success, and false otherwise? Additionally, your program should be able to handle data with multiple sequences and provide a breakdown of the success rate for each individual sequence. 
For example:
function isSequencingSuccessful(data) {
  let success = true;
  let successRates = [];
  for(let i=0; i<data.length; i++){
    let seqSuccess = true;
    // Check each sequence for the indicators of success
    if (data[i].length < 100) {
      seqSuccess = false;
    }
    if (data[i].includes("N")) {
      seqSuccess = false;
    }
    successRates.push(seqSuccess);
    if(!seqSuccess){
      success = false;
    }
  }
  console.log(successRates);
  return success;
}
Please note that the specific indicators of success may vary depending on the type of genetic sequencing experiment being performed.

