]

# Evaluate experiment success
success = isSequencingSuccessful(data)

# Print results
if success:
    print("Experiment successful.")
else:
    print("Experiment not successful.")
```

**Output:**

```
Sample 1: True
Sample 2: False
Sample 3: True
```

**Conclusion:**

