import pandas as pd

def isSequencingSuccessful(data):
    success = True
    success_rates = []
    for seq in data:
        success = success and (
            len(seq) >= 100
            and not any(n in "N" for n in seq)
            and all(
                variant in ["A", "C", "T", "G"]
                for variant in seq
            )
        )
        success_rates.append(success)

    return success and pd.Series(success_rates).mean() > 0.9
```

